$(document).ready((function(){$("[data-bs-hover-animate]").mouseenter((function(){var a=$(this);a.addClass("animated "+a.attr("data-bs-hover-animate"))})).mouseleave((function(){var a=$(this);a.removeClass("animated "+a.attr("data-bs-hover-animate"))}))}));var amountScrolled=800;$(window).scroll((function(){$(window).scrollTop()>amountScrolled?$("a#top").fadeIn("100"):$("a#top").fadeOut("100")})),$("a#top").click((function(){return $("html, body").animate({scrollTop:0},700),!1}));